import React from 'react';

class Test extends React.Component{
    constructor () {
        // this.onclick = this.onclick.bind(this)
        super()
        this.state = {
            a:1
        }
    }

    onclickAdd (a) {

       let b =  a+1;
        this.setState ({
            a:b
        })
    }

    onclickLess (a) {
        this.setState ({
            a : a-1
        })
     }


    render () {
        let {a} = this.state;
        return (
            <div>
                <p style={{marginLeft:100,marginTop:100}}>'贱贱饶武健' {a} </p>
                <button onClick={()=>this.onclickAdd(a)} style={{marginLeft:100,marginTop:100}}>点击</button>
                <button onClick={()=>this.onclickLess(a)} style={{marginLeft:100,marginTop:100}}>点击</button>
            </div>
        )
    } 
}

export  default Test;
